import React, { useEffect, useRef } from "react";
import Bird from "./Bird";
import Empty from "./Empty";

const ObjectCreatorBird = ({ objectIndex }) => {
    useEffect(() => {
        const { width, height } = document.getElementById("ObjectCreatorBird").getBoundingClientRect();
        console.log("Размер ObjectCreatorBird:", width, height);
    }, []);

    if (objectIndex >= 0 && objectIndex <= 94) {
        return <Empty />;
    } else if (objectIndex >= 95 && objectIndex <= 99) {
        return <Bird />;
    } else {
        return null;
    }
};

export default ObjectCreatorBird;
